angular.module("MyApp").factory("Job",function(t){return{getJobs:function(){return t.get("/api/v1/jobs/")},getJob:function(o){return t.get("/api/v1/jobs/"+o)},addJob:function(o){return t.post("/api/v1/jobs/",o)},updateJob:function(o){return t.put("/api/v1/jobs/"+o.id,o)},deleteJob:function(o){return t.delete("/api/v1/jobs/"+o)}}});